import {Box, Grid, Typography} from "@mui/material";
import jzPic from "../asset/jz.png";
import Projects from "./Projects";
import React from "react";

export default function LandingPage() {
    return (

        <Box id={"top"}>
            <Box>
                <Box
                    sx={{
                        // backgroundColor: "red",
                        minHeight: 600,
                        padding: {
                            xs: 5,
                            md: 10,
                        }
                    }}>
                    <Grid container spacing={2}
                          sx={{}}>
                        <Grid item sm={6} xs={12}
                              sx={{
                                  marginTop: 10,
                                  display: "flex",
                                  flexDirection: "column",
                                  paddingRight: "10%",
                                  alignItems: "end",
                                  minWidth: 500,
                                  textAlign: "right",
                              }}>
                            <Box>
                                <Typography variant={"h3"}>
                                    Hi! My name is <b
                                    className={"JZ"}>JZ</b>
                                </Typography>
                            </Box>

                            <Box
                                sx={{
                                    marginTop: 2
                                }}>
                                <Typography variant={"h2"}>
                                    周嘉良
                                </Typography>
                            </Box>
                            <Box sx={{
                                marginTop: 3
                            }}>
                                <Typography variant={"h4"}>
                                    UIUX Designer
                                </Typography>
                            </Box>
                            <Box sx={{
                                marginTop: 2
                            }}>
                                <Typography variant={"h4"}>
                                    Frontend Developer
                                </Typography>
                            </Box>
                            <Box sx={{
                                marginTop: 2
                            }}>
                                <Typography variant={"h4"}>
                                    Music Producer
                                </Typography>
                            </Box>
                        </Grid>
                        <Grid item sm={6} xs={12}>
                            <Box sx={{
                                display: "flex",
                                justifyContent: "center",
                            }}>
                                <Box
                                    component="img"
                                    alt="A picture of me(JZ)"
                                    src={jzPic}
                                />
                            </Box>
                        </Grid>
                    </Grid>
                </Box>
            </Box>

            <Projects/>

        </Box>
    )
}
